INSERT INTO `perfil` (`idPerfil`, `idArtista`, `idRedSocial`, `informacion`, `Foto`, `calificacion`) VALUES
(1, 1, 1, '  Hola, mi nombre es NgthKidd, y soy un pequeño productor musical que apenas empieza en esta gran carrera.\r\nElaboro tracks de musica electronica asi como beats de rap y trap.\"', , NULL);
INSERT INTO `perfil` (`idPerfil`, `idArtista`, `idRedSocial`, `informacion`, `Foto`, `calificacion`) VALUES
(2, 2, 2, 'Soy un cantante del genero trap, escribo mis propias canciones basadas en mis experiencias vividas como un joven adolecente, mi modo de hacer musica llega a ser un poco melancolico y triste pero siempre manteniendo el mismo estilo', , NULL);
INSERT INTO `perfil` (`idPerfil`, `idArtista`, `idRedSocial`, `informacion`, `Foto`, `calificacion`) VALUES
(3, 3, 3, ' George Miller, también llamado por su nombre pronunciado en Japonés, \"Joji\", es un comediante, productor de música y celebridad de Youtube. Es el creador de la tendencia conocida como el \"Harlem Shake\" y también por ser quién se encuentra detrás del personaje de Filthy Frank.', , NULL);
INSERT INTO `perfil` (`idPerfil`, `idArtista`, `idRedSocial`, `informacion`, `Foto`, `calificacion`) VALUES
(4, 4, 4, '  A los 25 años, el DJ y productor Bobby McKeon lo conoce como 4B ; ya ha pasado 11 años persiguiendo implacablemente su sonido y su visión. Durante este período, obtuvo un apoyo significativo de pesos pesados ​​de la industria como Skrillex, Diplo, Tiesto y DJ Snake. ', , NULL);

